title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o13064.m20 -> o13064.m5 -> o13064.m0 -> o13047.m19 -> o13047.m12 -> o13064.m0
  o13047.m12 -> o13064.m0 -> o13047.m19 -> o13047.m12
  o13047.m19 -> o13047.m12 -> o13064.m0 -> o13047.m19
  o13064.m5 -> o13064.m0 -> o13047.m19 -> o13047.m12 -> o13064.m0
  o13064.m9 -> o13064.m0 -> o13047.m19 -> o13047.m12 -> o13064.m0
  o13064.m0 -> o13047.m19 -> o13047.m12 -> o13064.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

